  //   });
  // }, []);

  return (
    <div className="gallery">
      {name.map((res, i) => (
        <div key={i}>
          <Link to={`${slug[i]}`}>
            <img src={thumb[i]} alt={res} />
          </Link>
        </div>
      ))}
    </div>
  );
};

export default Gallery;
